import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import { MapTo } from '@adobe/aem-react-editable-components';
import { HomePage } from '../HomePage/index';
require('./index.css')

export const LoginForm = ({ title, buttonName }) => {
    const navigateToHome = () => {
        <a href="/content/reactapp/us/en/homepage.html"></a>
    }

    return (
        <form action="/" method="post">
            <h1 className="form-title">{title}</h1>
            <div className="input-container">
                <input type="text" placeholder="UsuÃ¡rio" name="uname" className="form-input" />
                <input type="password" placeholder="Senha" name="psw" className="form-input" />
            </div>

            <button className="form-button" onClick={navigateToHome}>{buttonName}</button>
            <Router>
                <Switch>
                    <Route path="/content/reactapp/us/en/homepage.html"><HomePage /></Route>
                </Switch>
            </Router>
        </form>
    )
}
export default MapTo('reactapp/components/form-section')(LoginForm);
